export class ClaimItemDetail {
    empClaimItemId: string;
    claimItemId: string;
    caseId: string;
    claimId: string;
    itemType: string;
    itemName: string;
    apprAmt: number;
    apprBasis: string;
    formulaCode: string;
    formulaLabel: string;
    computedFormula: string;
    nature: string;
    computedAmt: number;
    submitAmt: number;
    submitAnnualAmt: number;
    // cpfSnapDate: string;
    allwDivisor: number;
    updatedBy: string;
    updatedDt: number;
    createdBy: string;
    createdDt: number;
    updatedByInit: string;
    latestStatus: string;
    latestStatusDesc: string;
    cpfSnapshotDto: CpfSnapshot;
    newCpfSnapshotDto: CpfSnapshot; // realtime
    empClaimItemOWDto: EmpClaimItemOW;
    empClaimItemAWDto: EmpClaimItemAW;
    empClaimItemDFDto: EmpClaimItemDF;
    empClaimItemOverseasDto: EmpClaimItemOverseas;
    empClaimItemInfoDtoList: EmpClaimItemInfo[];
    itemStatusDtoList: ItemStatus[];

    // FE
    canDelete: boolean;
}

export class CpfSnapshot {
    cpfSnapshotId: string;
    nric: string;
    csn: string;
    startYearMonth: string;
    endYearMonth: string;
    prepopulatedInd: string;
    latestContributionYearMonth: string;
    cpfSnapDate: string;
    cpfSnapshotInfoDtoList: CpfSnapshotInfo[];
    createdBy: string;
    createdDt: Date;
    updatedBy: string;
    updatedDt: Date;
    createdByInit: string;
}

export class CpfSnapshotInfo {
    cpfSnapshotInfoId: string;
    owAmount: number;
    awAmount: number;
    relevantContributionYearMonth: string;
    cpfSnapDate: string;
    latestContributionYearMonth: string;
}

export class EmpClaimItemOW {
    id: string;
    empClaimItemId: string;
    basicSalary: number;
    basicSalaryMod: number;
    contriDate: string;
    deduction: number;
    deductionMod: number;
    fixedAllowance: number;
    fixedAllowanceMod: number;
    variableAllowance: number;
    variableAllowanceMod: number;
}

export class EmpClaimItemAW {
    id: string;
    snapshotDivisor: number;
    empClaimItemId: string;
    periodEndYearMonth: string;
    periodYearMonth: string;
}

export class EmpClaimItemDF {
    id: string;
	empClaimItemId: string;
	manualCompDocId: string;
	frequency: string;
	fyStartDate: Date;
	fyEndDate: Date;
	noa1: number;
	noa2: number;
	type: string;
	annualAmt: number;
	annualDivisor: number;
    documentName: string;
    documentBy: string;
    documentDate: Date;
}

export class EmpClaimItemOverseas {
    id: string;
    empClaimItemId: string;
    countryCode: string;
    countryName: string;
    otherCountry: string;
    basicSalary: number;
    fixedAllowance: number;
    variableAllowance: number;
    totalAllowance: number;
    manualCompDocId: string;
    documentName: string;
    documentBy: string;
    documentDate: Date;
}

export class EmpClaimItemInfo {
    id: string;
    yrMth: string;
    amount: number;
    createdBy: string;
    createdDt: Date;
    updatedBy: string;
    updatedDt: Date;
    version: number;
}

export class ItemStatus {
    id: string;
    claimItemId: string;
    status: string;
    statusDesc: string;
    station: string;
    statusBy: string;
    statusDt: Date;
}
